import React from 'react';

import NavigationItem from './NavigationItem';

const navigationItems =( props )=>{
  return(
    <ul>
      <NavigationItem
        link="/login"
        exact
      >
      Login
      </NavigationItem>

      <NavigationItem
          link="/"
      >
        Plan
      </NavigationItem>
    </ul>
  );
};

export default navigationItems;
